description:
The following Associated Press &quot;test&quot; election results, marked 



&quot;NOT FOR PUBLICATION&quot;, 



were, presumably accidentially, released on the International Herald Tribune website at  &lt;a href=&quot;
http://www.iht.com/articles/ap/2008/09/30/america/Elected-All.php&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.iht.com/articles/ap/2008/09/30/america/Elected-All.php&lt;/a&gt;


The IHT is owned by the New York Times Company and is in practice the &quot;international&quot; version of the New York Times.

The list likely represents a test of AP's election coverage system, with its predicted headlines having been written well in advance. The document was obtained by Wikileaks staff after a tip off from a reader.
